import React, { useEffect, useState } from "react";

const LOCATION = {
    x : 127.42585033518178,
    y : 36.32787631122742
};

const SearchNaverMap = () => {
    const {naver} = window;
    const [address, setAddress] = useState('');

    useEffect(() => {

        const location = new naver.maps.LatLng(LOCATION.y, LOCATION.x);

        const options = {
            center : location,
            zoom : 16,
            zoomControl : true,
            zommControlOptions: {position : naver.maps.Position.TOP_RIGHT}
        };
        const map = new naver.maps.Map('naverMap', options);

        new naver.maps.Marker({
            position: location,
            map: map
        });


    }, []);

    


    return (
        <div>
            {<div className="buttons"></div>}
            <div id="naverMap" style={{width:'1000px', height:'500px'}}></div>
        </div>
    )
}

export default SearchNaverMap;
